import React from 'react';
import Pill from '../pill/pill.component'
import  CardList  from "../card-list/card-list.component";
import {SearchBox} from "../search-box/search-box.component.jsx";
import CustomButton  from "../custom-button/custom-button.component.jsx";
import { Link } from 'react-router-dom';
import './player-options.styles.scss';
import { connect } from 'react-redux';


export const PlayerOptions = ({filteredPlayers, addPlayer, positions, positionSelected, handlePositionChange, handleChange, teamsFull}) => {
   return (
    <div className="player-options">
    {console.log(teamsFull)}
    {teamsFull=='true' ?<Link to='/view-lines'> <CustomButton>View Lines</CustomButton></Link> : ''}

    <div className = 'player-options-content'>
    <div className = 'player-options-top'>
     <Pill items={positions} selectedItem={positionSelected} />
     <SearchBox
     placeholder="Search Player"
     handleChange={handleChange}
   />
   </div>
     <CardList players={filteredPlayers} />
     </div>
   </div>
   )
}

const mapStateToProps = (state)=>({

  teamsFull:state.lineup.teamsFull


})

connect(mapStateToProps)(PlayerOptions)
